settings = {
    "person square size" : (150,200),
    "person square margin" : (10,30),
    "person square size with margins": lambda: (settings["person square size"][0] + 2 * settings["person square margin"][0],settings["person square size"][1] + 2 * settings["person square margin"][1]),
    "person square center": lambda: (int(settings["person square size"][0] / 2),int(settings["person square size"][1] / 2)),
    "ancestor depth": 4,
    "chart direction": CHART_DIRECTION_DOWN,
    "line type": LINE_TYPE_SMOOTH,
    "text line height": 20,
    "person text format": "/F /L\n/B - /D",
    "date separator": ".",
    "background": 1
  }

class ChartPerson:
  def __init__(self, person_element, father_person, mother_person, chart_position): 
    self.name = person_element.name()[0]
    self.last_name = person_element.name()[1]
    self.male = person_element.gender() == "M"
    
    birth_info = person_element.birth()
    death_info = person_element.death()

    self.born = self._gedcom_string_to_date(birth_info[0])  # tuple (day,month,year)
    self.died = self._gedcom_string_to_date(death_info[0])  # tuple (day,month,year)
    self.chart_position = [chart_position[0],chart_position[1]]   # x, y
    self.parents = [father_person,mother_person]    # father, mother

  def _gedcom_string_to_date(self,gedcom_date_string):
    try:
      helper = gedcom_date_string.split()
    
      year = int(helper[2])
      day = int(helper[0])
     
      helper[1] = helper[1].lower()
      
      month = 1
      
      for m in ["jan","feb","mar","jun","jul","aug","sep","oct","nov","dec"]:
        if m == helper[1]:
          break
        
        month += 1
    
      return (day,month,year)
    except Exception:
      return (None,None,None)

  def _svg_multiline_text(self,text,x,y):
    result = "<text text-anchor=\"middle\" x=\"" + str(x) + "\" y=\"" + str(y) + "\"> "

    text = text.split("\n")
    dy = "0"
    
    for line in text:
      result += "<tspan x=\"" + str(x) + "\" dy=\"" + dy + "\">" + line + "</tspan>\n"
      dy = str(settings["text line height"])
    
    result += "</text>\n"
    
    return result
  
  # Processes the person text format. Supported symbols:
  # /F - first name
  # /L - last name
  # /B - birth date
  # /D - death date

  def _process_person_text(self,text):
    return text.replace("/F",self.name).replace("/L",self.last_name).replace("/B",self.date_string(self.born)).replace("/D",self.date_string(self.died))
  
  def date_string(self,date):
    result = ""
    
    if date[2] == None: # year
      return "?"
    
    result = str(date[2])
    
    if date[1] == None: # month
      return result
    
    result = str(date[1]) + settings["date separator"] + result
    
    if date[0] == None: # day
      return result
    
    result = str(date[0]) + settings["date separator"] + result
    
    return result
  
  def svg_code(self):
    square_center = settings["person square size"]
    result = ""
   # result += "<rect x=\"" + str(self.chart_position[0]) + "\" y=\"" + str(self.chart_position[1]) + "\" width=\"" + str(settings["person square size"][0]) + "\" height=\"" + str(settings["person square size"][1]) + "\" style=\"fill:rgb(200,200,200);\" />\n"

    result += "<use x=\"" + str(self.chart_position[0]) + "\" y=\"" + str(self.chart_position[1]) + "\" xlink:href=\"#portrait_male\" />\n"

    text = self._process_person_text(settings["person text format"])

    result += self._svg_multiline_text(text,self.chart_position[0] + settings["person square center"]()[0],self.chart_position[1] + settings["person square center"]()[1])            
    return result

# Holds information about a chart to be drawn

class ChartData:
  def __init__(self):
    self.people = []
    self.width = 0
    self.height = 0

  def _svg_people_connection(self,person1,person2):
    if person1 == None or person2 == None:
      return ""

    person1_pos = (person1.chart_position[0] + settings["person square center"]()[0],person1.chart_position[1])
    person2_pos = (person2.chart_position[0] + settings["person square center"]()[0],person2.chart_position[1] + settings["person square size"][1])

    x_pos = (str(person1_pos[0]),str(int((person1_pos[0] + person2_pos[0]) / 2)),str(person2_pos[0]))
    y_pos = (str(person1_pos[1]),str(int((person1_pos[1] + person2_pos[1]) / 2)),str(person2_pos[1]))
    
    if settings["line type"] == LINE_TYPE_SHARP:
      points = x_pos[0] + " " + y_pos[0] + " " + x_pos[0] + " " + y_pos[1] + " " + x_pos[1] + " " + y_pos[1] + " " + x_pos[2] + " " + y_pos[1] + " " + x_pos[2] + " " + y_pos[2]
      return "<polyline points=\"" + points + "\" style=\"fill:none;stroke:black;stroke-width:3\" />\n"
    elif settings["line type"] == LINE_TYPE_STRAIGHT:
      points = x_pos[0] + " " + y_pos[0] + " " + x_pos[2] + " " + y_pos[2]
      return "<polyline points=\"" + points + "\" style=\"fill:none;stroke:black;stroke-width:3\" />\n"
    else:
      points = "M" + x_pos[0] + " " + y_pos[0] + " Q" + x_pos[0] + " " + y_pos[1] + " " + x_pos[1] + " " + y_pos[1] + " " + x_pos[2] + " " + y_pos[1] + " " + x_pos[2] + " " + y_pos[2]
      return "<path d=\"" + points + "\" style=\"fill:none;stroke:black;stroke-width:3\" />\n"

  def svg_code(self):
    result = ""
    style_string = ""
    
    if settings["background"] == 1:
      style_string = "style=\"background-image: " + IMAGE_BACKGROUND1 + "\""
    
    result += "<svg xmlns=\"http://www.w3.org/2000/svg\" xmlns:xlink=\"http://www.w3.org/1999/xlink\" height=\"" + str(self.height) + "\" width=\"" + str(self.width) + "\" " + style_string + ">\n"
    result += SVG_DECLARATIONS
    
    for person in self.people:
      result += person.svg_code()
      
    for person in self.people:
      result += self._svg_people_connection(person,person.parents[0])
      result += self._svg_people_connection(person,person.parents[1])
    
    result += "</svg>\n"
    return result

  def make_ancestor_tree(self, gedcom_data, person_element):
    chart_info = self._make_ancestor_tree_helper(gedcom_data,person_element,settings["ancestor depth"])
    self.width = chart_info[0]
    self.height = chart_info[1] * settings["person square size with margins"]()[1]
    
    if (settings["chart direction"] == CHART_DIRECTION_DOWN):
      for person in self.people:
        person.chart_position[1] = self.height - person.chart_position[1] - settings["person square size with margins"]()[1]
    
  # Makes an ancestor tree for given person in the graph.
  #
  # @return tuple (tree_width,level_reached,parent_instance)

  def _make_ancestor_tree_helper(self, gedcom_data, person_element, depth=5, x_offset=0, level=0):
    if person_element == None or level > depth:
      return (0,level,None)
    
    parents = gedcom_data.get_parents(person_element)
    
    father = None
    mother = None
    
    for parent in parents:
      if parent.gender() == "M":
        father = parent
      elif parent.gender() == "F":
        mother = parent
    
    father_tree_info = self._make_ancestor_tree_helper(gedcom_data,father,depth,x_offset,level + 1)
    mother_tree_info = self._make_ancestor_tree_helper(gedcom_data,mother,depth,x_offset + father_tree_info[0],level + 1)
    
    tree_width = max(father_tree_info[0] + mother_tree_info[0],settings["person square size with margins"]()[0])
    level_reached = max(father_tree_info[1],mother_tree_info[1])
    
    chart_position = (x_offset + int(tree_width / 2) + settings["person square margin"][0],level * settings["person square size with margins"]()[1])
    
    new_person = ChartPerson(person_element,father_tree_info[2],mother_tree_info[2],chart_position)
    
    #new_person = ChartPerson()
    #new_person.name = person_element.name()[0]
    #new_person.last_name = person_element.name()[1]
    #new_person.chart_position[0] = x_offset + int(tree_width / 2) + settings["person square margin"][0]
    #new_person.chart_position[1] = level * settings["person square size with margins"]()[1]
    #new_person.parents[0] = father_tree_info[2]
    #new_person.parents[1] = mother_tree_info[2]
    
    self.people.append(new_person)
    
    return (tree_width,level_reached,new_person)
    
# program start

argument_parser = argparse.ArgumentParser()

argument_parser.add_argument("person", help="target person, the first person of given name will be taken (use additional arguments to specify concrete individual)", type=str)
argument_parser.add_argument("input_file", help="input GEDCOM file name", type=str)
argument_parser.add_argument("-o","-output-file", help="output SVG file name", type=str, default="output.svg")
argument_parser.add_argument("-a","--ancestor-depth", type=int, help="number of ancestor generations to display", default=4)
argument_parser.add_argument("-d","--descendant-depth", type=int, help="number of descendant generations to display", default=4)
argument_parser.add_argument("-m","--marriage", help="include the target person's husband/wife", action="store_true")
argument_parser.add_argument("-b","--born", help="birth year of the target person", default=None)

arguments = argument_parser.parse_args()

helper_name = arguments.person.lstrip().rstrip().split()
person_name = (helper_name[0],helper_name[1])

gedcom_data = gedcom.Gedcom(arguments.input_file)

person_element = None

# find the person

for element in gedcom_data.element_list():
  if element.is_individual() and person_name[0] == element.name()[0] and person_name[1] == element.name()[1]:
    person_element = element
    break

if person_element == None: # person not found
  sys.stderr.write("Error: person not found.")



# make the chart

chart_data = ChartData()

chart_data.make_ancestor_tree(gedcom_data,person_element)

# draw the chart:

output_file = open(arguments.o,"w")
output_file.write("<?xml version=\"1.0\"?>\n")
output_file.write("<!DOCTYPE svg PUBLIC \"-//W3C//DTD SVG 1.0//EN\" \"http://www.w3.org/TR/2001/REC-SVG-20010904/DTD/svg10.dtd\">\n")
output_file.write(chart_data.svg_code())
output_file.close()